import styleContainer from "./TaskList.module.css";

const TaskCircleProgress = () => {
  return (
    <svg
      width="24"
      height="24"
      viewBox="0 0 24 24"
      className={styleContainer.circularProgressbar}
    >
      <circle
        className={styleContainer.circleBackground}
        cx="12"
        cy="12"
        r="11"
        strokeWidth="2px"
      ></circle>
      <circle
        className={styleContainer.circleProgress}
        cx="12"
        cy="12"
        r="11"
        strokeWidth="2px"
        transform="rotate(-90 12 12)"
        style={{ strokeDasharray: 0, strokeDashoffset: 69.115 }}
      ></circle>
    </svg>
  );
};

export default TaskCircleProgress;
